import React from "react"
import {Avatar, Card} from 'antd'
const UserProfile = () => {
    return (
            <Card>
                <Card.Meta 
                    avatar={<Avatar></Avatar>}
                    title="Jellyfish"
                />
            </Card>
    );
}

export default UserProfile
